<!DOCTYPE html>
<html lang="zh">
  <head>
    <meta charset="utf-8">
    <meta http-equiv="X-UA-Compatible" content="IE=edge">
    <meta name="viewport" content="width=device-width,initial-scale=1.0">
    <link rel="icon" href="<%= BASE_URL %>favicon.ico">
    <link rel="stylesheet" href="https://at.alicdn.com/t/font_2030495_pwo1zu1ka1.css">
    <link rel="stylesheet" href="https://at.alicdn.com/t/font_1331132_5lvbai88wkb.css">
    <link rel="stylesheet" href="https://at.alicdn.com/t/font_444910_5x8cv55o6el.css">
    <title><%= htmlWebpackPlugin.options.title %></title>
    <style>
      @font-face {
        font-family: 'iconfont';  /* project id 444910 */
        src: url('//at.alicdn.com/t/font_444910_5x8cv55o6el.eot');
        src: url('//at.alicdn.com/t/font_444910_5x8cv55o6el.eot?#iefix') format('embedded-opentype'),
        url('//at.alicdn.com/t/font_444910_5x8cv55o6el.woff2') format('woff2'),
        url('//at.alicdn.com/t/font_444910_5x8cv55o6el.woff') format('woff'),
        url('//at.alicdn.com/t/font_444910_5x8cv55o6el.ttf') format('truetype'),
        url('//at.alicdn.com/t/font_444910_5x8cv55o6el.svg#iconfont') format('svg');
      }
    </style>
  </head>
  <body>
    <noscript>
      <strong>We're sorry but <%= htmlWebpackPlugin.options.title %> doesn't work properly without JavaScript enabled. Please enable it to continue.</strong>
    </noscript>
    <div id="app"></div>
    <!-- built files will be auto injected -->
  </body>
</html>
